import React from "react";

function TodoSearch ({searcValue,setSearchValue})
{
  return (
    <input 
    className="input_search" 
    placeholder="ingresar busqueda" 
    value={searcValue}
    onChange={(event)=>{
      setSearchValue(event.target.value);
    }}
    />
  );
}

export {TodoSearch};
